import React from "react";
import cityweather from './city-weather';


function CityList(){
    console.log(cityweather);

    return (
        <div>

          {cityweather.map(city=>{
                <City name={city.name}/>
          })}


        </div>
    )
}

function City({name}){
    return(
        <div>
            <h2>{name}</h2>
        </div>
    )

}

export default CityList;
